  var ADIOS_windows = {};
  var desktop_main_box_history = [];
  var desktop_keyboard_shortcuts = [];

  var adios_menu_hidden = 0;

  function window_popup(controller, params, options) {
    if (typeof options == 'undefined') options = {};

    if (options.type == 'POST') {
      let paramsObj = _ajax_params(params);
      let formHtml = '';

      formHtml = '<form action="' + _APP_URL + '/' + _controller_url(controller, {}, true) + '" method=POST target="adios_popup">';
      for (var i in paramsObj) {
       formHtml += '<input type="hidden" name="' + i + '" value="' + paramsObj[i] + '" />';
      }
      formHtml += '</form>';

      // console.log(_APP_URL + '/' + _controller_url(controller, {}, true));
      // console.log(formHtml);
      $(formHtml).appendTo('body').submit();
    } else {
      window.open(_APP_URL + '/' + _controller_url(controller, params));
    }
  }

  function window_render(controller, params, onclose, options) {
    if (typeof params == 'undefined') params = {};
    if (typeof options == 'undefined') options = {};

    params.__IS_WINDOW__ = '1';

    $('.adios.main-content .windows').addClass('update-in-progress');

    setTimeout(function() {
      _ajax_read(controller, params, function(html) {

        // if (params.windowParams && params.windowParams.uid) {
        //   $('#' + params.windowParams.uid).remove();
        // }

        $('.adios.main-content .windows').show();
        $('.adios.main-content .windows').removeClass('update-in-progress');

        $('.adios.main-content .windows .windows-content').append(html);
        // window_post_render(html, controller, params, options);

      });

    }, 0);
  }

  function window_post_render(html, controller, url, params, options) {
  // console.log(url);
  // alert('a');
    // $('.adios.main-content .windows .windows-content').append(html);

    windowId = $('.adios.ui.Window')
      .last()
      .attr('id')
    ;

    let sameWindows = $('.adios.ui.Window[id="' + windowId + '"]');

    if (sameWindows.length > 1) {
      sameWindows.eq(0).remove();
    }

    if ($('.adios.ui.Window').length == 1) {
      $('#' + windowId).addClass('inline');
    } else {
      $('#' + windowId).addClass('modal');
    }

    if (typeof options.onAfterRender == 'function') {
      options.onAfterRender(windowId);
    }

    if ($('.adios.ui.Window').length == 1 && url != '') {
      desktop_main_box_history_push(
        url,
        params,
        $('.adios.main-content').html(),
        options
      );
    }

    ADIOS_windows[windowId] = {
      'controller': controller,
      'url': url,
      'params': params,
      'onclose': onclose,
    };
  }

  function window_refresh(windowId) {
    let win = $('#' + windowId);

    if (win.length > 0) {
      win
        .attr('id', win.attr('id') + '_TO_BE_REMOVED')
      ;
      window_render(
        ADIOS_windows[windowId]['controller'],
        ADIOS_windows[windowId]['params'],
        ADIOS_windows[windowId]['onclick'],
      );

      setTimeout(function() {
        win.remove();
      }, 500);
    }
  }

  function window_close(windowId, oncloseParams) {
    if (!ADIOS_windows[windowId]) {
      // okno bolo otvarane cez URL
      window.location.href = _APP_URL;
    } else {

      if ($('.adios.main-content .adios.ui.Window').length == 1) {
        window.history.back();
      }

      $('#' + windowId).find('a.--onclose-href').trigger('click');
      $('#' + windowId).remove();

      if ($('.adios.main-content .adios.ui.Window').length == 0) {
        $('.adios.main-content .windows').hide();
      }

      if (typeof ADIOS_windows[windowId]['onclose'] == 'function') {
        ADIOS_windows[windowId]['onclose'](oncloseParams);
      }

    }

  }

  function window_close_all() {
    for (windowId in ADIOS_windows) {
      window_close(windowId);
    }
  }

  function desktop_update(controller, params, options) {
    desktop_render(controller, params, options);
  };

  function desktop_render(controller, params, options) {
    if (typeof params == 'undefined') params = {};
    if (typeof options == 'undefined') options = {};

    $('.adios.main-content').css('opacity', 0.5);

    if (options.type == 'POST') {
      let paramsObj = _ajax_params(params);
      let formHtml = '';

      formHtml = '<form action="' + _APP_URL + '/' + _controller_url(controller, {}, true) + '" method=POST>';
      for (var i in paramsObj) {
       formHtml += '<input type="hidden" name="' + i + '" value="' + paramsObj[i] + '" />';
      }
      formHtml += '</form>';

      $(formHtml).appendTo('body').submit();
    } else {
      window.location.href = _APP_URL + '/' + _controller_url(controller, params, true);
    }

  }


  function desktop_main_box_history_push(controller, params, html, options) {
    if (typeof options != 'object') options = {};

    window.history.pushState(
      {
        "html": html,
        "pageTitle": document.title,
      },
      "",
      _APP_URL + '/' + _controller_url(controller, params, true)
    );

  };

  window.onpopstate = function (e) {
    if (e.state) {
      document.title = e.state.pageTitle;
    }
  };



  function _alert(text, params) {

    if (typeof params == 'undefined') params = {};

    params.resizable = params.resizable ?? false;
    params.modal = params.modal ?? true;
    params.width = params.width ?? 450;
    params.title = (params.title ?? _TRANSLATIONS['Information']) ?? 'Information';
    params.titleClass = params.titleClass ?? '';
    params.contentClass = params.contentClass ?? '';
    params.confirmButtonText = params.confirmButtonText ?? _TRANSLATIONS['OK, I understand'];
    params.confirmButtonClass = params.confirmButtonClass ?? '';
    params.cancelButtonText = params.cancelButtonText ?? _TRANSLATIONS['Cancel'];
    params.cancelButtonClass = params.cancelButtonClass ?? '';

      
    if (params.width > $(window).width()) params.width = $(window).width() - 20;
    if (params.buttons == '' || typeof params.buttons == 'undefined') {
      params.buttons = [
        {
          'text': params.confirmButtonText,
          'fa_icon': 'fas fa-check',
          'class': 'btn-primary btn-icon-split ' + params.confirmButtonClass,
          'onclick': function() {
            if (typeof params.onConfirm == 'function') params.onConfirm();
            $(this).closest('.adios.ui.window').remove();
          }
        }
      ];

      if (typeof params.onConfirm == 'function') {
        params.buttons.push({
          'text': params.cancelButtonText,
          'fa_icon': 'fas fa-times',
          'class': 'btn-secondary btn-icon-split ' + params.cancelButtonClass,
          'onclick': function () {
            $(this).closest('.adios.ui.window').remove();
          }
        });
      }
    }

    let buttonsHtml = '';
    for (let i in params.buttons) {
      let button = params.buttons[i];
      buttonsHtml += '<button type="button" class="btn ' + button.class + '" btn-index="' + i + '">';
      buttonsHtml +=   '<span class="icon">';
      buttonsHtml +=     '<i class="' + button.fa_icon + ' mr-1"></i>';
      buttonsHtml +=   '</span>';
      buttonsHtml +=   '<span class="text">' + button.text + '</span>';
      buttonsHtml += '</button>';
    }

    let html = '<div class="adios ui window modal">';
    html += '  <div class="modal-dialog shadow" role="document">';
    html += '      <div class="modal-content ' + params.contentClass + '">';
    html += '          <div class="modal-header ' + params.titleClass + '">';
    html += '              <h5 class="modal-title">' + params.title + '</h5>';
    html += '              <button type="button" class="close" data-dismiss="modal" aria-label="Close">';
    html += '                  <span aria-hidden="true">&times;</span>';
    html += '              </button>';
    html += '          </div>';
    html += '          <div class="modal-body">';
    html += '              <p>' + text + '</p>';
    html += '          </div>';
    html += '          <div class="modal-footer">';
    html += buttonsHtml;
    html += '          </div>';
    html += '      </div>';
    html += '  </div>';
    html += '</div>';

    var window_div = $(html)
      .prependTo('body')
    ;

    $(window_div).find("button.close").bind('click', function() {
      $(this).closest('.adios.ui.window').remove();
    });

    $(window_div).find(".btn-primary").focus();

    for (let i in params.buttons) {
      $(window_div).find("button[btn-index='" + i + "']").bind('click', params.buttons[i].onclick)
    }
  };

  function _warning(message) {
    _alert(
      message,
      {
        title: 'Warning',
        titleClass: 'bg-warning text-white',
        contentClass: 'text-warning',
        confirmButtonClass: 'btn-warning',
      }
    );
  }

  function _fatal(message) {
    _alert(
      message,
      {
        title: 'Fatal error',
        titleClass: 'bg-danger text-white',
        contentClass: 'text-danger',
        confirmButtonClass: 'btn-danger',
      }
    );
  }

  function _confirm(text, params, callback) {
    params.title = params.title ?? _TRANSLATIONS['Confirmation'];
    params.onConfirm = callback;
    _alert(text, params);
  }

  function _prompt(text, params, callback) {
    params.title = 'Prompt';
    params.onConfirm = callback;

    if (params.use_textarea) text += "<br/><textarea style='width:95%;height:70px;' id='desktop_confirm_prompt_input'></textarea><br/>";
    else text += "<br/><input type='text' style='width:95%;' id='desktop_confirm_prompt_input' /><br/><br/>";

    params.buttons = [
        {
            'text': 'OK',
            'class': 'btn-primary',
            'onclick': function() {
                if (typeof params.onConfirm == 'function') params.onConfirm($('#desktop_confirm_prompt_input').val());
                $(this).closest('.adios.ui.window').remove();
            },
        },
        {
            'text': 'Zrušiť',
            'class': 'btn-secondary',
            'onclick': function () {
                $(this).closest('.adios.ui.window').remove();
            },
        }
    ];

    _alert(text, params);
  };



  

var _ajax_debug = false;
var _ajax_custom_params = {};
var _ajax_auto_tabindex = 0;
_adios_shortcut_listener_enabled = 0;

function _ajax_update_dynamic_scripts(selector) {

  setTimeout(function(){
    if ($("button[data-adios-keyboard-shortcut]").length > 0) _adios_shortcut_listener_enabled = 1;
    else  _adios_shortcut_listener_enabled = 0;
  }, 300);

  $("<div>" + selector + "</div>").each(function() {
    var d = $(this).get(0); // document.getElementById(el_id);
    if (d == null) return;

    // najdem vsetky script tagy a vlozim do head
    var s = d.getElementsByTagName('script');
    var newScript;

    for (var x = 0; x < s.length; x++) {
      try {
        newScript = document.createElement('script');
        newScript.type = 'text/javascript';
        if (s[x].src != '') {

          xmlHttpObject = false;
          if (window.XMLHttpRequest) { // Mozilla, Safari,...
            xmlHttpObject = new XMLHttpRequest();
            if (xmlHttpObject.overrideMimeType) {
              xmlHttpObject.overrideMimeType('text/html; charset=windows-1250');
            }
          } else if (window.ActiveXObject) { // IE
            try {
              xmlHttpObject = new ActiveXObject('Msxml2.XMLHTTP');
            } catch (e) {
              try {
                 xmlHttpObject = new ActiveXObject('Microsoft.XMLHTTP');
              } catch (e) {}
            }
          };

          xmlHttpObject.open('GET', s[x].src, false);
          xmlHttpObject.send(null);
          newScript.text = xmlHttpObject.responseText;
        } else {
          newScript.text = s[x].text;
        };

        document.body.appendChild (newScript);

        // ked script vlozim do headru, vymazem ho z elementu
      } catch (ex) { };
    };
    /* */
  });

};

function _ajax_set_custom_param(param_name, param_value) {
  _ajax_custom_params[param_name] = param_value;
}

function _ajax_params(params, clean_for_history) {
  let tmp = {};
  let paramsObj = {};

  if (typeof params == 'string') {
    tmp = parseStr(params);
  } else {
    tmp = params || {};
  }

  for (var i in tmp) {
    if (i != 'controller' && i != '__C__') {
      if (!clean_for_history || (i != '__IS_AJAX__' && i != '__IS_WINDOW__')) {
        paramsObj[i] = tmp[i]; // (typeof tmp[i] === 'object' ? JSON.stringify(tmp[i]) : tmp[i].toString());
      }
    }
  }

  // console.log('_ajax_params', params, clean_for_history, params_obj);

  return paramsObj;
}

function _controller_url(controller, params, clean_for_history) {
  if (typeof params == 'undefined') params = '';

  var params_obj = _ajax_params(params, clean_for_history);
  var params_str = '';
  for (var i in params_obj) {
    params_str += (params_str == '' ? '' : '&') + i + '=' + encodeURIComponent(params_obj[i]);
  };

  // btoa() pri niektorych znakoch nefunguje
  // let url = controller + (params_str == '' ? '' : '?' + params_str + '&__C__=' + btoa(JSON.stringify(params_obj)));
  let url = controller + (params_str == '' ? '' : '?' + params_str);

  return url;
}

function _ajax_controller_url(controller, params) {
  return _controller_url(controller, params) + '&__IS_AJAX__=1';
}

function _ajax_post_data(params) {
  let postData = {};
  let paramsObj = _ajax_params(params);
  
  for (var i in paramsObj) {
    postData[i] = paramsObj[i];
  }

  postData['__IS_AJAX__'] = '1';

  return postData;
}

function _ajax_load(controller, params, onsuccess) {
  if (typeof params == 'undefined') params = new Object;
  if (typeof onsuccess == 'undefined') onsuccess = function(){};
  params.adios_ajax_json_call = 1;

  if (onsuccess == "synchronous") {
    res = _ajax_sread(controller, params);
    res = _ajax_check_json_format(res);
  }else{
    _ajax_read(controller, params, function(res) {
      res = _ajax_check_json_format(res);
      onsuccess(res);
    });
    res = 1;
  }

  return res;

}

// kontrola json, odstranenie znakov pre a za {}
function _ajax_check_json_format(res){
  var before_json = '';
  var after_json = '';
  var first_bracket = res.indexOf('{');
  if (first_bracket > 0){
    before_json = res.substring(0,first_bracket);
    res = res.substring(first_bracket);
    console.log('AJAX_LOAD JSON ERROR (before json)', before_json);
  }
  var last_bracket = res.lastIndexOf('}');
  if ((last_bracket + 1) < res.length){
    after_json = res.substring(last_bracket + 1);
    res = res.substring(0, last_bracket + 1);
    console.log('AJAX_LOAD JSON ERROR (after json)', after_json);
  }

  try {
    res = JSON.parse(res);
  } catch ( err ) {
    if (_DEVEL_MODE){
      if (before_json == "" && after_json == "") console.log("AJAX JSON PARSE ERROR", res);
    }
    res = {};
    res.result = '';
    res.error = true;
    res.error_code = 1007;
    res.error_message = 'ERROR PARSING JSON';
  }


  return res;
}

// fcia kontroluje _ajax_load json result, v pripade chyby ju vypise, ale je to mozne vypnut
function _ajax_check_result(res, use_alert = true){
  if (res.error != false){
    if (use_alert) _alert(res.error_message);
    return false;
  }else{
    return true;
  }
}

function _ajax_read(controller, params, onsuccess, onreadystatechange) {
  $.ajax({
    // 'type': 'GET',
    // 'url': _APP_URL + '/' + _ajax_controller_url(controller, params),
    // 'data': data,

    'type': 'POST',
    'url': _APP_URL + '/' + controller,
    'data': _ajax_post_data(params),

    'success': function(res) {
      try {
        var resJson = JSON.parse(res);
      } catch (ex) {
        var resJson = null;
      }

      if (resJson === null || typeof resJson != 'object') {
        if (typeof onsuccess == 'function') {
          onsuccess(res);
        }
      } else {
        switch (resJson.result) {
          case 'WARNING':
            _warning(resJson.content);
          break;
          case 'FATAL':
            _fatal(resJson.content);
          break;
          case 'SUCCESS':
          default:
            if (typeof onsuccess == 'function') {
              onsuccess(resJson.content);
            }
          break;
        }
      }

      // if (controller != 'Desktop/Ajax/GetConsoleAndNotificationsContent') {
      //   desktop_console_update();
      // }
    },
    'xhr': function() {
      var newxhr = $.ajaxSettings.xhr();

      if (typeof onreadystatechange == 'function') {
        newxhr.onreadystatechange = onreadystatechange;
      };

      return newxhr;
    },
    'error': function (e) {
      if (typeof onresult == 'function') {
        onresult(null);
      }

      // if (controller != 'Desktop/Ajax/GetConsoleAndNotificationsContent'){
      //   if (e.status == 0) _alert('Failed to connect to server.');
      //   else _alert('Server error: ' + e.status);
      //   desktop_console_update();
      // };
    }
  });
};

function _ajax_read_json(controller, params, onsuccess, onwarning, onfatal) {
  $.ajax({
    // 'type': 'GET',
    // 'url': _APP_URL + '/' + _ajax_controller_url(controller, params),

    'type': 'POST',
    'url': _APP_URL + '/' + controller,
    'data': _ajax_post_data(params),

    'dataType': 'json',
    'success': function(res) {
      if (res.result == 'SUCCESS') {
        if (typeof onsuccess == 'function') {
          onsuccess(res.content);
        } else {
          _alert('SUCCESS\n\n' + JSON.stringify(res.content));
        }
      } else if (res.result == 'WARNING') {
        if (typeof onwarning == 'function') {
          onwarning(res.content);
        } else {
          _alert('WARNING\n\n' + JSON.stringify(res.content));
        }
      } else if (res.result == 'FATAL') {
        if (typeof onfatal == 'function') {
          onfatal(res.content);
        } else {
          _alert('FATAL\n\n' + JSON.stringify(res.content));
        }
      }
    }
    //'complete': function() { desktop_console_update(); }
  });
};

